import React, { Component } from 'react';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

import FishGame from './fish_game_files/FishGame';

class FishGameContainer extends Component {
	render() {
		return (
			<div>
				<FishGame />
			</div>
		);
	}
}

export default FishGameContainer;
